// Namespace the things: Stand Together Blog Landing
var stbl = {};

stbl.url = null;
stbl.count = 1;
stbl.cat = [];
stbl.tag = [];
stbl.search = '';
stbl.prId = null;

// Search keyup interval
stbl.searchInterval = null;

// Update the blog grid with data from the rest API
stbl.updateGrid = function updateGrid(posts) {
    // If the count is 1
    if (stbl.count == 1) {
        // Remove the current posts
        $('#blog-grid').empty();

        // If there are no posts returned from the query, show the no posts message
        if (!posts.length) {
            var noPosts = '<div class="no-results">No posts found.</div>';

            $('#blog-grid').append(noPosts);
        }
    }

    posts.forEach(function (el, arr, ind) {
        var img = '';

        if (el.better_featured_image) {
            var fImage = el.better_featured_image.media_details;
            if (fImage.sizes['post-thumbnail']) {
                var imgUrl = fImage.sizes['post-thumbnail'].source_url;
                img = '<img class="blog-card-image" src="' + imgUrl + '">';
            }
        }

        var dateObj = new Date(el.date);
        var dateStr = dateObj.toLocaleDateString('en-US', {
            day: 'numeric',
            month: 'long',
            year: 'numeric'
        });

        var post = '<div class="column">\n            <a href="/' + el.slug + '" class="blog-card">\n                <div class="flex-container">\n                    ' + img + '\n                    <div class="flex-child-auto blog-card-text">\n                        <h5 class="blog-card-title">' + el.title.rendered + '</h5>\n                        <div class="blog-card-date">' + dateStr + '</div>\n                        <div class="blog-card-summary">' + el.summary + '</div>\n                    </div>\n                </div>\n                <div class="blog-card-small-text">' + el.summary + '</div>\n            </a>\n        </div>';

        $('#blog-grid').append(post);
    });

    stbl.updateButton();
};

// Show or hide the load more button
stbl.updateButton = function updateButton() {
    // If we have as many posts as the count * posts_per_page, show the button
    if ($('#blog-grid > .column').length == stbl.count * 10) {
        $('#load-more').addClass('show');
    } else {
        $('#load-more').removeClass('show');
    }
};

// Update query string
stbl.updateQS = function updateQS() {
    var qs = {};
    if (stbl.count > 1) {
        qs.count = stbl.count;
    }
    if (stbl.cat.length) {
        qs.cat = stbl.cat;
    }
    if (stbl.tag.length) {
        qs.tag = stbl.tag;
    }
    if (stbl.search) {
        qs.search = stbl.search;
    }

    var qsStr = $.param(qs, true);

    history.replaceState(null, '', window.location.pathname + '?' + qsStr);
};

// Query the wp rest API for posts
stbl.getPosts = function getPosts() {
    // Assemble query string
    var qs = {};
    if (stbl.count > 1) {
        qs.page = stbl.count;
    }
    if (stbl.cat.length || stbl.tag.length) {
        qs.filter = {};
    }
    if (stbl.cat.length) {
        qs.filter.category_name = stbl.cat.join();
    }
    if (stbl.tag.length) {
        qs.filter.tag = stbl.tag.join();
    }
    if (stbl.prId) {
        qs.tags_exclude = stbl.prId;
    }
    if (stbl.search) {
        qs.search = stbl.search;
    }
    var qsStr = decodeURIComponent($.param(qs));

    // Query the API and pass the data to updateGrid()
    $.get('/wp-json/wp/v2/posts?' + qsStr, stbl.updateGrid);
};

// Executed when load more button is clicked
// Gets more
stbl.loadMore = function loadMore() {
    // Iterate count
    stbl.count = stbl.count + 1;

    // Update query string, and get new posts
    stbl.updateQS();
    stbl.getPosts();
};

stbl.searchPosts = function search() {
    var _this = this;

    // Initiate the search 1s after the user stops typing
    // If there is an exisiting interval, clear it
    clearInterval(stbl.searchInterval);
    // Set a new interval
    stbl.searchInterval = setInterval(function () {
        stbl.search = $(_this).val();
        stbl.count = 1;

        // Update query string, and get new posts
        stbl.updateQS();
        stbl.getPosts();

        // Reset the interval
        clearInterval(stbl.searchInterval);
    }, 1000);
};

stbl.updateCats = function updateCats(e) {
    stbl.count = 1;
    var cat = $(this).attr('data-cat');

    if ($(this).is(':checked')) {
        stbl.cat.push(cat);
    } else {
        _.pull(stbl.cat, cat);
    }

    // Update the query string, and get new posts
    stbl.updateQS();
    stbl.getPosts();
};

$(document).ready(function () {
    if ($('#blog-grid').length) {
        // Initialize variables
        stbl.url = $.url();
        stbl.count = stbl.url.param('count') || 1;

        if (_.isString(stbl.url.param('cat'))) {
            stbl.cat = [stbl.url.param('cat')];
        } else {
            stbl.cat = stbl.url.param('cat') || [];
        }

        stbl.tag = stbl.url.param('tag') || [];
        stbl.search = stbl.url.param('search');
        stbl.prId = $('#blog-grid').data('pr-id');

        // Initialize load more button
        stbl.updateButton();

        // Initialize search bar
        $('#blog-search').val(stbl.search);

        // Initialize industry dropdown
        stbl.cat.forEach(function (el, ind, arr) {
            $('#industry-' + el).prop('checked', true);
        });

        // Attach event listeners
        $('#load-more').click(_.debounce(stbl.loadMore, 300));
        $('#blog-search').keyup(stbl.searchPosts);
        $('.card-dropdown-check').click(stbl.updateCats);
    }
});
