var st = {};

st.getDimensions = function getDimensions(element) {
    var jqElement = $(element);
    var dimensions = {
        height: jqElement.height(),
        width: jqElement.width(),
        scrollTop: jqElement.scrollTop(),
        screenHeight: $(window).height(),
        screenWidth: $(window).width(),
        bodyHeight: $('body').height(),
        bodyWidth: $('body').width()
    };

    return dimensions;
};

st.toggleBackToTop = function toggleBackToTop() {
    var dimensions = st.getDimensions(window);
    var dimensionsFooter = st.getDimensions('#footer-container');

    if (dimensions.scrollTop > 1.5 * dimensions.screenHeight && dimensions.scrollTop + dimensions.screenHeight < dimensions.bodyHeight - dimensionsFooter.height) {
        $('#back-to-top').removeClass('show-footer');
        $('#back-to-top').addClass('show');
    } else if (dimensions.scrollTop + dimensions.screenHeight >= dimensions.bodyHeight - dimensionsFooter.height) {
        $('#back-to-top').removeClass('show');
        $('#back-to-top').addClass('show-footer');
    } else {
        $('#back-to-top').removeClass('show');
        $('#back-to-top').removeClass('show-footer');
    }
};

